        // parsing and collecting nodes and edges from the python
        nodes = new vis.DataSet([{"color": "#377eb8", "id": "1970-2015_varsel_484", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNytt \u003cb\u003evarsel\u003c/b\u003e vU ikke bli sendt fra Bergvesenet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_484\u003cbr\u003etype: usage\u003c/p\u003e", "x": 268.18687380366447, "y": 488.2454568427055}, {"color": "#377eb8", "id": "1929-1965_varsel_153", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen alltid samme m\u00f8rke himmel forut, med \u003cb\u003evarsel\u003c/b\u003e om \u00e5pent\u003cbr\u003evann. Nu st\u00e5r planen sin svennepr\u00f8ve.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_153\u003cbr\u003etype: usage\u003c/p\u003e", "x": 202.72118931920562, "y": -624.1860826304372}, {"color": "#377eb8", "id": "1929-1965_varsel_253", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEn vil treffe bestemmelser om oppsigelse p\u00e5 kort \u003cb\u003evarsel\u003c/b\u003e.\u003cbr\u003e4. De allierte ekspedisjonsstyrker vil betale for rekvirert sivil\u003cbr\u003earbeidskraft og kvarter i den tid som dekkes av denne avtalen. Den\u003cbr\u003enorske regjering vil betale for forsyninger, hjelpemidler og\u003cbr\u003etjenester, dermed medregnet bruken av fast eiendom, unntatt: a. For\u003cbr\u003emindre viktige rekvirerin- ger. b. I de tilfelle hvor vanskeligheter\u003cbr\u003evil oppst\u00e5 p\u00e5 grunn av en for- sinket betaling. c. I de tilfelle hvor\u003cbr\u003ebetaling er \u00f8n- skelig av sikkerhetshensyn.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_253\u003cbr\u003etype: usage\u003c/p\u003e", "x": 750.0, "y": 349.08972941803916}, {"color": "#377eb8", "id": "1970-2015_varsel_3156", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDette ville regulaert forutsette at en advokat uten\u003cbr\u003eforkunnskaper i saken p\u00e5 meget kort\u003cb\u003e varse\u003c/b\u003el utarbeider\u003cbr\u003eskriftlige innlegg\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_3156\u003cbr\u003etype: usage\u003c/p\u003e", "x": -601.9922442221042, "y": 96.96811269323922}, {"color": "#377eb8", "id": "1970-2015_varsel_980", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEn unders\u00f8kelse rettet mot innsigelsesmyndig- hetene viser at\u003cbr\u003edet er en ganske utbredt praksis \u00e5 gi \u003cb\u003evarsel\u003c/b\u003e om innsigelse, og\u003cbr\u003eat det er vanlig at de innvendinger som fagmyndighetene har resulterer\u003cbr\u003ei at kommunen og fagmyndigheten blir enige om en l\u00f8sning. Fordelingen\u003cbr\u003eer 63,9 % faktisk gitte inn- Vedlegg 3 Bedre kommunal og regional\u003cbr\u003eplanlegging etter plan- og bygningsloven Tabell 3.1 1 Antall\u003cbr\u003einnsigelsessaker mottatt og avgjort i Milj\u00f8verndepartementet (kilde:\u003cbr\u003eMilj\u00f8vemdepartmentet) sigelser, 34 % varsel om innsigelser , og 2,1 %\u003cbr\u003eforesl\u00e5tte, men ikke gitte innsigelser.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_980\u003cbr\u003etype: usage\u003c/p\u003e", "x": 354.31289872896167, "y": -345.08550605496936}, {"color": "#377eb8", "id": "1929-1965_varsel_192", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen det er samtidig klart at man ved en generell bestemmelse m\u00e5\u003cbr\u003eta tilsvarende forbehold som de man har tatt i prisloven. De\u003cbr\u003ebestemmelser om \u003cb\u003evarsel\u003c/b\u003e som saerlovgivningen inneholder og som\u003cbr\u003estiller strengere krav, vil da fremdeles ha sin betydning, likesom det\u003cbr\u003ealltid vil vaere en oppgave ved utferdigelse av nye forvaltningslover\u003cbr\u003e\u00e5 overveie om det er mulig p\u00e5 det spesielle forvaltningsomr\u00e5de \u00e5 g\u00e5\u003cbr\u003elengere og vaere strengere med hensyn til kravet om forh\u00e5ndsvarsling\u003cbr\u003eenn den generelle forvaltningsl\u003cspan style=\"color:#808080;\"\u003eov.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_192\u003cbr\u003etype: usage\u003c/p\u003e", "x": 134.88297860823764, "y": 183.826675929741}, {"color": "#377eb8", "id": "1970-2015_varsel_2770", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEkstraordinaer generalforsamling kan innkalles p\u00e5\u003cbr\u003e\u00f8yeblikkelig\u003cb\u003e varse\u003c/b\u003el dersom dette finnes p\u00e5trengende n\u00f8dvendig.\u003cbr\u003eBare aksjonaerer har stemmerett p\u00e5 generalforsamlinge\u003cspan style=\"color:#808080;\"\u003en.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_2770\u003cbr\u003etype: usage\u003c/p\u003e", "x": -258.551818643401, "y": -435.327264193228}, {"color": "#377eb8", "id": "1970-2015_varsel_2051", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet skal innkalles til en generalforsamling gjennom et\u003cbr\u003eskriftlig \u003cb\u003evarsel\u003c/b\u003e som sendes med et tilgjengelig middel til alle\u003cbr\u003epersoner som har rett til \u00e5 delta i SCE-foretakets generalforsamling i\u003cbr\u003esamsvar med artikkel 58 nr. 1 og 2 og vedtektenes bestemmelser.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_2051\u003cbr\u003etype: usage\u003c/p\u003e", "x": 66.47007922897384, "y": 532.6010104202968}, {"color": "#377eb8", "id": "1929-1965_varsel_85", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNar det ventes at vatn vil bli forurenset som brukes til\u003cbr\u003ehusholdning eller g\u00e5rdsdrift, kan det vilk\u00e5r settes at den som f\u00e5r\u003cbr\u003etillatelsen, skal skaffe annen vassforsyning eller yte tilskudd til\u003cbr\u003edet. Antas fisket i vassdraget \u00e5 ville lide, kan det betinges at det\u003cbr\u003eskal s\u00f8rges for utslipping av fiskeyngel. Selv om tillatelse er gitt,\u003cbr\u003eplikter den som foretar utslippingen \u00e5 erstatte skade som voldes\u003cbr\u003eannenmann med hensyn til eiendom eller rettigheter, s\u00e5fremt skaden er\u003cbr\u003eav noen betydning. Hvis erstatning for skade ved forurensing fra\u003cbr\u003eindustritiltak ikke blir betalt til den tid som er fastsatt ved avtale\u003cbr\u003eeller dom, kan den erstatningsberettigede med en ukes \u003cb\u003evarsel\u003c/b\u003e\u003cbr\u003ekreve at driften skal stanse til betaling skjer. 2 Det som er fastsatt\u003cbr\u003ei punkt 3, gjelder ogs\u00e5 overfor senere innehaver av virksomheten, men\u003cbr\u003ebare s\u00e5fremt den berettigede innen ett \u00e5r etter at erstatningen\u003cbr\u003eforfalt til betaling har reist sak eller nedlagt forbud mot videre\u003cbr\u003eutslipping ved midlertidig forf\u00f8yning etter loven om\u003cbr\u003etvangsfullbyrdelse.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_85\u003cbr\u003etype: usage\u003c/p\u003e", "x": -251.19184099309675, "y": -667.0060481257394}, {"color": "#377eb8", "id": "1970-2015_varsel_152", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFor S\u00f8r-Norges vedkommende kan vi hva ang\u00e5r en fiendtlig\u003cbr\u003einvasjon, p\u00e5regne et betydelig lengre strategisk \u003cb\u003evarsel\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_152\u003cbr\u003etype: usage\u003c/p\u003e", "x": -282.3608376437053, "y": -153.6674555277646}, {"color": "#377eb8", "id": "1929-1965_varsel_52", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen det die ikke s\u00f8rget kor at de korsvarsinidier en n\u00e5dde,\u003cbr\u003eogs\u00e5 virkelig die gjort disponidie pa kortest inuiig \u003cb\u003evarsel\u003c/b\u003e i\u003cbr\u003etilkelle av akutt krigskare.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_52\u003cbr\u003etype: usage\u003c/p\u003e", "x": -515.0873633093495, "y": -157.53219438888306}, {"color": "#377eb8", "id": "1929-1965_varsel_431", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDette tyktes dem \u00e5 baere ille\u003cb\u003e varse\u003c/b\u003el\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_431\u003cbr\u003etype: usage\u003c/p\u003e", "x": -664.7888825240544, "y": -479.0704781512223}, {"color": "#377eb8", "id": "1970-2015_varsel_2167", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMen ikke sjelden er det slik at den utbyggingen det s\u00f8kes om\u003cbr\u003etillatelse til ogs\u00e5 er identisk med den som fremgikk av et tidligere\u003cbr\u003eplan\u003cb\u003evarsel\u003c/b\u003e, eller varsel om dispensasjon eller mindre vesentlig\u003cbr\u003eendring av en plan.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_2167\u003cbr\u003etype: usage\u003c/p\u003e", "x": 420.66859801146586, "y": 359.51086291857735}, {"color": "#377eb8", "id": "1929-1965_varsel_224", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBor eieren p\u00e5 samme sted som panthaveren, har han dog gjerne\u003cbr\u003ekrav p\u00e5 2 ukers \u003cb\u003evarsel\u003c/b\u003e (Tvangsl. \u00a7 191).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_224\u003cbr\u003etype: usage\u003c/p\u003e", "x": -184.12372872871993, "y": 651.5208776414771}, {"color": "#377eb8", "id": "1929-1965_varsel_285", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLikevel var det eit kl\u00e5rt \u003cb\u003evarsel\u003c/b\u003e om at\u003cbr\u003en\u00f8ytralitetspolitikken skulle vera styrelina i Sverige og, d\u00e5\u003cbr\u003eregjeringa vart omskipa 13. desember, og utriksminister Sandler vart\u003cbr\u003eskift med Giinther, men fulltrygg kjende ein seg likevel ikkje.\u003cbr\u003eJolaftan sette Koht opp tankane sine om Finnlandspolitikken s\u00e5leis\u003cbr\u003e(notat 24. desember 1939, U.D. 35 G. 2 V):\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_285\u003cbr\u003etype: usage\u003c/p\u003e", "x": 331.7963237714151, "y": -81.94364507441847}, {"color": "#377eb8", "id": "1970-2015_varsel_1890", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eLoven av 1936 har ingen regler om hvordan inkassovirksomhet\u003cbr\u003eskal ut\u00f8ves, eUer i hvilken grad inkassator og fordringshaveren kan\u003cbr\u003eavkreve skyldneren erstatning for utgiftene forbundet med\u003cbr\u003einkassosaken. I tUlegg foresl\u00e5r utvalget i lovutkastet \u00a7 4 at\u003cbr\u003einkassator (etter \u00e5 ha overtatt kravet til inkasso og kontrollert at\u003cbr\u003e\u003cb\u003evarselet\u003c/b\u003e etter \u00a7 3 er sendt), skriftlig skal oppfordre\u003cbr\u003eskyldneren tU \u00e5 betale eUer fremkomme med innsigelser innen en frist\u003cbr\u003esom ikke m\u00e5 settes kortere enn 14 dager. Det er utformet forslag tU\u003cbr\u003enaermere regler om hvilke opplysninger kravet skal inneholde, s\u00e5 som\u003cbr\u003eidentifikasjon av hovedstol, renter og omkostninger\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_1890\u003cbr\u003etype: usage\u003c/p\u003e", "x": 515.027478506893, "y": 91.26720445593995}, {"color": "#377eb8", "id": "1970-2015_varsel_3084", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI dag ville metallprisene neppe stige med mer enn 500 kr pr\u003cbr\u003etonn, alts\u00e5 omkring 10% om man etter et rimelig \u003cb\u003evarsel\u003c/b\u003e ble\u003cbr\u003ehenvist til \u00e5 klare seg med lokalt r\u00e5stoff. c) Magnesium (Mg), titan\u003cbr\u003e(Ti), silicium (Si) Magnesium er det letteste av samtlige\u003cbr\u003ekonstruksjonsrnetaller.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_3084\u003cbr\u003etype: usage\u003c/p\u003e", "x": 83.92446775792533, "y": -330.03271998337937}, {"color": "#377eb8", "id": "1970-2015_varsel_1619", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet er mulig \u00e5 fa \u003cb\u003evarsel\u003c/b\u003e om sverming av gulrotflue, fare\u003cbr\u003efor angrep av t\u00f8rr\u00e5te i potet, r\u00e5d om spr\u00f8yting mot storknollet\u003cbr\u003er\u00e5tesopp i oljevekster og om bekjemping av k\u00e5lfly.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_1619\u003cbr\u003etype: usage\u003c/p\u003e", "x": 545.5484776115106, "y": -235.13752123904223}, {"color": "#377eb8", "id": "1929-1965_varsel_238", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEt muntlig \u003cb\u003evarsel\u003c/b\u003e til medlemmet enten ved personlig\u003cbr\u003enaervaer eller pr. telefon er ikke nok for \u00e5 tilfredsstille lovens\u003cbr\u003ekra\u003cspan style=\"color:#808080;\"\u003ev.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_238\u003cbr\u003etype: usage\u003c/p\u003e", "x": -19.172476447489792, "y": -86.22296406254226}, {"color": "#377eb8", "id": "1970-2015_varsel_2272", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUtvalget antar at et slikt maskinelt \u003cb\u003evarsel\u003c/b\u003e kan f\u00f8re til\u003cbr\u003euklarhet og forvirring.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_varsel_2272\u003cbr\u003etype: usage\u003c/p\u003e", "x": -452.5286932681025, "y": 285.5489266332695}, {"color": "#377eb8", "id": "1929-1965_varsel_180", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eP\u00e5 enkelte omr\u00e5der er det i lov eller forskrift fastsatt at en\u003cbr\u003emer \u00fcbestemt krets av interesserte skal ha \u003cb\u003evarsel\u003c/b\u003e \u2014 enten\u003cbr\u003edirekte eller gjennom alminnelig kunngj\u00f8ring om den innkomne\u003cbr\u003es\u00f8knad.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_varsel_180\u003cbr\u003etype: usage\u003c/p\u003e", "x": -144.32899186730748, "y": 172.21559025378136}, {"color": "#377eb8", "id": "1929-1965_varsel_361", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePeder hadde nugget og s\u00e5tt et gjerde langt inne p\u00e5\u003cbr\u003epresteg\u00e5rdens skog og tross \u003cb\u003evarsel\u003c/b\u003e ikke tatt det bort, men\u003c
